import { useEffect, useState } from 'react';

interface PassengerProfile {
  fname: string;
  lname: string;
  email: string;
  phone: string;
  address: string;
}

const ProfilePage = () => {
  const [profile, setProfile] = useState<PassengerProfile | null>(null);

  useEffect(() => {
    // TODO: Înlocuiește cu apel real către API
    const fakeUser: PassengerProfile = {
      fname: 'Andrei',
      lname: 'Popescu',
      email: 'andrei@example.com',
      phone: '0712345678',
      address: 'București, România'
    };
    setProfile(fakeUser);
  }, []);

  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gray-50 px-4">
      <h2 className="text-3xl font-bold mb-6"> Profilul Meu </h2>
      {profile && (
        <div className="bg-white p-6 rounded-xl shadow max-w-md w-full space-y-3">
          <p><strong>Prenume:</strong> {profile.fname}</p>
          <p><strong>Nume:</strong> {profile.lname}</p>
          <p><strong>Email:</strong> {profile.email}</p>
          <p><strong>Telefon:</strong> {profile.phone}</p>
          <p><strong>Adresă:</strong> {profile.address}</p>
        </div>
      )}
    </div>
  );
};

export default ProfilePage;
